description:
This is an outdoor topo map of northwest part of USA for Magellan GPS eXplorist 110, 310, 510, 610, 710 devices.
Made by A c c u t e r r a and I n t e r m a p in 2011 year.

To install this map you should connect your GPSr to PC and copy two files (us-northwest.imi and us-northwest.tpo) to HDDMAP folder in your eXplorist divice.
Or you can install this map to microSD flash memory card. Just copy both files to MAP folder on the memoty card.

Warning!!!!!

If you have any good Magellan GPS vector maps of Europe (especially Eastern Europe: Ukraine, Russia, Moldova, Belarus), please contact me at e-mail

